import React from 'react';

function FullMedicine({medicine}) {
    return (
        <div>
            {medicine.map((data) => (
                <li className='medicine_block_list'>
                    <img src={data.imageUrl} alt=""/>
                    {data.name}</li>
            ))}
        </div>
    );
}

export default FullMedicine;
